import React, { Component } from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import Card from "@material-ui/core/Card";
import img4 from "../image/cam3.jpg";
import img from "../image/eos6d.jpg";
import img2 from "../image/eos5dsr.jpg";
import img3 from "../image/k1.jpg";
import img5 from "../image/d5.png";
import img6 from "../image/markIV.jpg";
import img7 from "../image/d3500.png";
import img8 from "../image/d3400.png";
import img9 from "../image/eos800.png";
import img10 from "../image/d5600.jpg";
import img11 from "../image/eos750.jpg";
const styles = theme => ({
  button: {
    marginLeft: "55%",
    marginTop: "-18%",
    backgroundColor: " rgb(115, 70, 124)",
    border: "none",
    color: "white",
    fontFamily: "'Montserrat', sans-serif"
  },
  div: {
    width: "100%",
    height: "15em"
  },
  top: {
    fontSize: 25,
    textTransform: "uppercase",
    marginTop: "-35%",
    marginLeft: "1%",
    fontWeight: "bold",
    textAlign: "center",
    color: "black",
    border: "2px solid black",
    padding: "2%",
    fontFamily: " 'Lato', light 300 ",
    position: "absolute"
  },
  ima: {
    width: "60%",
    height: "140%",
    paddingBottom: "4%"
  },
  ima1: {
    width: "50%",
    height: "50%",
    marginLeft: "20%"
  },
  header: {
    borderRadius: "5px",
    fontSize: "30px",
    paddingBottom: "-10%",
    paddingLeft: " 5%",
    fontFamily: "'Lobster', cursive",
    color: "rgb(115, 70, 124)",
    width: "100%",
    height: "2em"
  },
  part: {
    padding: "3%",
    border: "1px solid rgb(115, 70, 124)"
  },
  tag: {
    fontSize: "12px",
    marginLeft: "50%"
  }
});

class Result extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { classes } = this.props;
    return (
      <div>
        <Card component="div" className={classes.div}>
          <img className={classes.ima} src={img4} alt="img4" />
          <Typography className={classes.top}>
            Ti si <strong>{this.props.quizResult}</strong>!
          </Typography>{" "}
        </Card>
      </div>
    );
  }
}
Result.propTypes = {
  quizResult: PropTypes.string.isRequired
};
Result.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Result);
